export function omitKeys(o, keys) {
    return Object.keys(o).reduce((a, k) => {
        if (!keys.includes(k))
            a[k] = o[k];
        return a;
    }, {});
}
export function pickKeys(o, keys) {
    return Object.keys(o).reduce((a, k) => {
        if (keys.includes(k))
            a[k] = o[k];
        return a;
    }, {});
}
